/**
 * 创建一个剔除所有给定值的新数组，剔除值的时候，使用SameValueZero做相等比较。
 * 注意: 不像_.pull, 这个方法会返回一个新数组。
 * @param array (Array): 要检查的数组。
 * @param values  (...*): 要剔除的值。
 * @returns (Array): 返回过滤值后的新数组。
 * @example
 * _.without([2, 1, 2, 3], 1, 2);
 * // => [3]
 */
export default function without(array: any[], ...values: any): any[];
